import "./about.scss";

export default function Works() {
  return (
    <div className="about" id="about">
      <div className="left">
        <div className="wrapper">
          <h1>Sobre Mí</h1>
          <span>Hola, mi nombre es Darwin Rogel, me enfoco al desarrollo de software, principalmente me entusiasma trabajar con tecnologías del lado del Backend, sin embargo, también tengo conocimientos sólidos en la parte del Frontend. Además, he realizado trabajos en el ámbito de infraestructura tecnológica.


Soy autodidacta y constantemente me gusta adquirir nuevos conocimientos y compartir todo lo aprendido. Me apasiona la filosofía del Open Source y promulgarla cuando es conveniente.</span>
        </div>
      </div>
      <div className="right">
        <div className="imgContainer">
          <img src="assets/persona.png" />
        </div>
      </div>
    </div>
  );
}
